// JavaScript Document
import React from 'react';
import Link from '@material-ui/core/Link';

//Smart Component
class Main extends React.Component {
	//declaring state and new object
	state ={
		recipeListing: []
	}

//calling fetchData function
	componentDidMount(){
	this.fetchData();
}

//fetch Api data and map json results in a list format
	fetchData(){

	fetch('/api/v1/parks?&api_key=YpbDDtsNwQRi13JXZXiN7DnEIusWnKQLsCZW11xq')
		.then(results =>{
		return results.json();
	}).then(data =>{

		let mList = data.results.map((use)=>{
			return(
				<li key={this.props.id}>
				<span key={use.results}>
				<img src={use.images[1].url} alt={use.images[1].altText} />
				<h2>{use.name}</h2>
				<h6>{use.city}, {use.stateCode}</h6>
				<p>Park Details: {use.entrancePasses}</p>
				<p>Park Description: {use.description}</p>
				<p>Park Activities: {use.activities}</p>
				<p>Park Info: {use.directionsInfo}</p>
				<Link href='{use.directionsUrl}'>{use.directionsUrl}</Link><br /><br /><br />
				</span>
				</li>
			)
		})
		this.setState({main:mList});
	})
}
	 render() { 
  return (
		<div>{this.state.main}</div>			
  	);
  }
}

export default Main
